import React, { useState, useEffect } from "react";
import { BrowserRouter, Switch, /*NavLink,*/ Route } from "react-router-dom";
import Header from './components/navigation/Header';
import Footer from "./components/navigation/Footer";
import apiFacade from "./services/apiFacade";
import HomePage from "./components/HomePage";
import Recipes from "./components/Recipes"
import HomemadeRecipes from "./components/Recipes";
import SearchPage from "./components/SearchPage";
import Login from "./components/Login";
import LoggedIn from "./components/LoggedIn";
import SignUp from "./components/SignUp";
import Profile from "./components/Profile";
import AddRecipe from "./components/AddRecipe";

const NoMatch = () => <div>Urlen matcher ingen kendte routes</div>;

function Content(props) {
  const {recipes, loggedIn} = props;  

  return (
    <Switch>
      <Route exact path="/">
        <HomePage />
      </Route>
      <Route path="/recipes">
        <Recipes recipes={recipes}/>
      </Route>
      <Route path="/homemade-recipes">
        <Recipes recipes={recipes}/>
      </Route>
      <Route path="/search">
        <SearchPage />
      </Route>
      <Route path="/login">
        <Login />
      </Route>
      <Route path="/signup" exact>
        <SignUp />
      </Route>
      <Route path="/profile" exact>
        <Profile />
      </Route>
      <Route path="/add-recipe" exact>
        <AddRecipe />
      </Route>

      <Route path='/about' render={() => <h1>About Us</h1>} exact />
      <Route path='/terms' render={() => <h1>Terms</h1>} exact />
      <Route path='/privacy' render={() => <h1>Privacy Policy</h1>} exact />
      
      <Route path="*">
        <NoMatch />
      </Route>
      
    </Switch>
  );
}

function App({apiFacade}) {

  return (
    <>
      <BrowserRouter>
        <Header/>
            
        <main className="main"><div className="container">
            <Content apiFacade={apiFacade} />
        </div></main>

        <Footer />
      </BrowserRouter>    
    </>
  );
}

export default App;
